import React, { Component } from 'react';
import BuyerOrderService from '../services/BuyerOrderService';

class ListBuyerOrdersComponent extends Component {

    constructor(props){
        super(props)
        this.state={

            BuyerOrder: []

        }
    }

    componentDidMount(){
        BuyerOrderService.getBuyerOrder().then((res)=>{
            this.setState({BuyerOrder: res.data})
        })
    }
    render() {
        return (
            <div>

                <h2 className = "text-center" >Orders List</h2>
                <div className = "row">
                    <table className = "table table-striped table-bordered">

                        <thead>
                            <tr>
                                <th>Order ID</th>
                                <th>UserName</th>
                                <th>Email</th>
                                <th>Address</th>
                                <th>Contact Number</th>
                                <th>Date</th>
                                <th>Total</th>
                                

                            </tr>
                        </thead>

                        <tbody>
                            {
                                this.state.BuyerOrder.map(
                                   BuyerOrder =>
                                   <tr key = {BuyerOrder.buyerOrderID}>
                                       <td>{BuyerOrder.username}</td>
                                       <td>{BuyerOrder.email}</td>
                                       <td>{BuyerOrder.contact}</td>
                                       <td>{BuyerOrder.address}</td>
                                       <td>{BuyerOrder.total}</td>
                                       <td>{BuyerOrder.date}</td>
                    
                                   </tr> 
                                )
                            }
                        </tbody>
                    </table>
                </div>
            </div>
        );
    }
}

export default ListBuyerOrdersComponent;
